'use client';

import { CreateQuoteForm, EditQuoteForm as EIQ, InvoiceItem, PDFInvoiceItem, QuoteItemForm } from '@/app/lib/definitions';
import {
  ArrowUturnLeftIcon,
  EnvelopeIcon,
  PrinterIcon,
} from '@heroicons/react/24/outline';
import Link from 'next/link';
import { Button } from '@/app/ui/button';
import { useEffect, useState } from 'react';
import { Col, Row } from 'antd';
import Image from 'next/image';
import jsPDF from "jspdf";
import "jspdf-autotable";
import { fontSize } from '@mui/system';


declare module "jspdf" {
  interface jsPDF {
    autoTable: (options: any) => jsPDF;
  }
}

export default function ViewQuoteForm({ quote, quoteItemList }:
  { quote: EIQ, quoteItemList: QuoteItemForm[] }) {

  const [quoteItems, setQuoteItems] = useState<InvoiceItem[]>([]);

  useEffect(() => {
    let list = [...quoteItems];
    quoteItemList.map((item, i) => {
      let obj: InvoiceItem = {
        id: item.id,
        productId: item.product_id,
        productName: item.package_name,
        itemName: "",
        description: item.description,
        quantity: item.quantity,
        itemPrice: item.price,
        itemTotalAmount: item.total_amount
      };
      list[i] = obj;
    })
    setQuoteItems(list);
  }, []);


  const [formData, setFormData] = useState<CreateQuoteForm>({
    quoteId: quote.quote_id,
    customerId: quote.customer_id,
    leadId: quote.lead_id,
    quoteNumber: quote.quote_number,
    currencyId: quote.currency_id,
    currencySymbol: quote.currency_symbol,
    quoteStatus: quote.quote_status,
    quoteDate: quote.quote_date,
    quoteExpiryDate: quote.expiry_date,
    note: quote.note,
    quoteItems: quoteItems,
    quoteSubTotal: quote.quote_sub_amount,
    quoteTaxId: quote.tax_id,
    quoteTaxValue: quote.tax_slab,
    quoteTaxAmount: quote.tax_amount,
    quoteTotalAmount: quote.quote_total_amount
  });


  const emailQuote = () => {
    setFormData((prevData) => ({ ...prevData, quoteItems: quoteItems }));
    //updateInvoiceForm(formData);
  }

  
  const printQuote = () => {
    const doc = new jsPDF();

    // Invoice Data
    const companyDetails = {
      name: "Sheeraz Tours Pvt Ltd",
      address: "Locknow - 560098",
      phone: "(800) 555-1234",
    };

    const clientDetails = {
      name: "Jonathan Neal",
      address: "101 E. Chapman Ave, Orange, CA 92866",
      phone: "(800) 555-4321",
    };

    const invoiceDetails = {
      invoiceNumber: quote.quote_number,
      date: quote.quote_date,
      dueDate: quote.expiry_date,
    };

    const items: PDFInvoiceItem[] =  quoteItems;

    const taxRate = quote.tax_slab; // 5%
    const subtotal = quote.quote_sub_amount;
    const tax = quote.tax_amount;
    const total = quote.quote_total_amount;

    doc.setFont("Roboto", "normal");
    
    // Header
    doc.autoTable({
      head: [["    ","          ","Quotation","    ","    "]],
      startY: 20,
      startX:205,
      theme: "striped",
      headStyles: { fillColor: [0, 150, 255], textColor: [255, 255, 255], align:"center", fontSize:24 },
    })

    const logoBase64 = "data:image/jpeg;base64,"; // Base64 string
    doc.addImage(logoBase64, "JPEG", 13, 40, 50, 12); 
    
    // Company Details
    doc.setFontSize(12);
    doc.text(companyDetails.name, 15, 75);
    doc.text(companyDetails.address, 15, 80);
    doc.text(`Phone: ${companyDetails.phone}`, 15, 85);

    // Client Details
    doc.text("Bill To:", 15, 95);
    doc.text(clientDetails.name, 15, 100);
    doc.text(clientDetails.address, 15, 105);
    doc.text(`Phone: ${clientDetails.phone}`, 15, 110);

    // Invoice Details
    doc.text(`Invoice #: ${invoiceDetails.invoiceNumber}`, 145, 40);
    doc.text(`Date:      ${invoiceDetails.date}`, 145, 45);
    doc.text(`Due Date:  ${invoiceDetails.dueDate}`, 145, 50);

    // Table with AutoTable
    doc.autoTable({
      head: [["Item","Description", "Quantity", "Price", "Total"]],
      body: items.map((item) => [
        item.productName,
        item.description,
        item.quantity,
        item.itemPrice,
        item.itemTotalAmount
      ]),
      startY: 125,
      theme: "striped",
      headStyles: { fillColor: [0, 150, 255], textColor: [255, 255, 255] },
    });

    doc.setFontSize(12);
    // Add Subtotal, Tax, and Total
    const finalY = (doc as any).lastAutoTable.finalY + 9;
    doc.text(`Subtotal (INR) :    ${subtotal.toLocaleString()}`, 135, finalY);
    doc.text(`Tax (${taxRate}%) :            ${tax.toLocaleString()}`, 135, finalY + 10);
    doc.setFont("Roboto", "bold");
    doc.text(`Total (INR) :       ${total.toLocaleString()}`, 135, finalY + 20);

    // Save PDF
    doc.save("Invoice.pdf");
  };


  return (
    // <form action={createInvoice}>
    <>
      <div className="mt-6 pb-5 flex justify-end gap-4">

        <Button onClick={printQuote}><PrinterIcon className="h-5" /></Button>
        <Button onClick={emailQuote}><EnvelopeIcon className="h-5" /> {" Quotation"}</Button>
        <Link
          href="/dashboard/quotes"
          className="flex h-10 items-center rounded-lg px-4 text-sm font-medium text-gray-800 transition-colors hover:bg-gray-300"
        >
          <ArrowUturnLeftIcon className="h-5" />
        </Link>
      </div>


      <div id="printable-div" className="container mx-auto  p-5 border border-gray-400">
        <div className='rounded-md-50 pt-5 pb-5 bg-blue-600 text-white text-lg'>
          <h1 className="text-center uppercase text-lg text-md">Quotation</h1>
        </div>
        <div className="float-right rounded-md  p-4 md:p-6">

        </div>
        <div>
          <Image
            src="/Logo.jpg"
            width={300}
            height={100}
            className="block pt-10 pb-10 pl-10"
            alt="Sheeraz Tours pvt ltd"
          />
        </div>

        <Row className=' rounded-md-50 pt-16 pb-16 min-w-fit'>

          <div className="w-1/5 pl-10">
            <p>From : </p>
            <p>Sheeraz Tours pvt ltd
              Locknow - 560098
              (800) 555-1234</p>
          </div>
          <div className="w-1/5 pl-10 bg-gray-10">
            <p>{'To :'} </p>
            <p>Jonathan Neal 101 E. Chapman Ave
              Orange, CA 92866
              (800) 555-1234</p>
          </div>
          <div className="w-1/4 "><p>{'  '}</p></div>
          <table className="w-1/3 pr-5 text-sm border-separate">
            <tbody>
              <tr>
                <th className="border p-1 text-center relative rounded border-solid border-gray-300 bg-gray-200"><span >Quote #</span></th>
                <td className="border p-1 text-center relative rounded border-solid border-gray-300 "><span >{quote.quote_number}</span></td>
              </tr>
              <tr>
                <th className="border p-1 text-center relative rounded border-solid border-gray-300 bg-gray-200"><span >Date</span></th>
                <td className="border p-1 text-center relative rounded border-solid border-gray-300 "><span >{quote.quote_date}</span></td>
              </tr>
              <tr>
                <th className="border p-1 text-center relative rounded border-solid border-gray-300 bg-gray-200"><span >Expiry Date</span></th>
                <td className="border p-1 text-center relative rounded border-solid border-gray-300 "><span>{quote.expiry_date}</span></td>
              </tr>
              <tr>
                <th className="border p-1 text-center relative rounded border-solid border-gray-300 bg-gray-200"><span >Amount Due</span></th>
                <td className="border p-1 text-center relative rounded border-solid border-gray-300 "><span> {Number(formData.quoteTotalAmount!).toLocaleString("en-US", { style: "currency", currency: "INR" })}</span></td>
              </tr>
            </tbody>
          </table>
        </Row>



        <Row gutter={[12, 12]} style={{ position: 'relative' }} className='bg-gray-200 rounded-md-50 pt-2 pb-2 text-center'>
          <Col className="gutter-row border-b" span={5}>
            <p>{'Item'}</p>
          </Col>
          <Col className="gutter-row border-b" span={7}>
            <p>{'Description'}</p>
          </Col>
          <Col className="gutter-row border-b" span={3}>
            <p>{'Quantity'}</p>
          </Col>
          <Col className="gutter-row border-b" span={4}>
            <p>{'Price'}</p>
          </Col>
          <Col className="gutter-row border-b" span={4}>
            <p>{'Total'}</p>
          </Col>

        </Row>

        {quoteItems.map((data, i) => {
          return (
            <Row key={i} gutter={[12, 12]} style={{ position: 'relative' }} className=' rounded-md-50'>
              <Col className="gutter-row pb-1 border-b border-l text-center" span={5}>
                <div className="relative mt-5 rounded-md">
                  <p>{data.productName}</p>
                </div>
              </Col>
              <Col className="gutter-row pb-1 border-b border-l text-center" span={7}>
                <div className="relative mt-5 rounded-md">
                  <p>{data.description}</p>
                </div>
              </Col>
              <Col className="gutter-row pb-1 border-b border-l text-center" span={4}>
                <div className="relative mt-5 rounded-md">
                  <p>{data.quantity}</p>
                </div>
              </Col>
              <Col className="gutter-row pb-1 border-b border-l text-center" span={4}>
                <div className="relative mt-5 rounded-md">
                  <p>{Number(data.itemPrice!).toLocaleString("en-US", { style: "currency", currency: "INR" })}</p>
                </div>
              </Col>
              <Col className="gutter-row pb-1 border-b border-l text-center" span={4}>
                <div className="relative mt-5 rounded-md">
                  <p>{Number(data.itemTotalAmount!).toLocaleString("en-US", { style: "currency", currency: "INR" })}</p>
                </div>
              </Col>
            </Row>
          );
        })}

        <Row gutter={[12, 12]} className=' rounded-md-50'>
          <Col className="gutter-row" span={5}>
            <p>{' '}</p>
          </Col>
          <Col className="gutter-row" span={7}>
            <p>{' '}</p>
          </Col>
          <Col className="gutter-row" span={4}>
            <p>{' '}</p>
          </Col>
          <Col className="bg-gray-100 pt-3 gutter-row border-b border-l  text-center" span={4}>
            <label htmlFor="subTotal" className="mb-2 block text-sm font-medium">
              Sub Total :
            </label>
          </Col>
          <Col className="p-2 gutter-row border-b border-l  text-center" span={4}>
            <div className="relative mt-2 rounded-md">
              <p>{Number(quote.quote_sub_amount!).toLocaleString("en-US", { style: "currency", currency: "INR" })}</p>
            </div>
          </Col>

        </Row>

        <Row gutter={[12, 12]} className=' rounded-md-50'>
          <Col className="gutter-row" span={5}>
            <p>{' '}</p>
          </Col>
          <Col className="gutter-row" span={7}>
            <p>{' '}</p>
          </Col>
          <Col className="gutter-row" span={4}>
            <p>{' '}</p>
          </Col>
          <Col className=" bg-gray-100 pt-3 gutter-row border-b border-l text-center" span={4}>
            <div className="  mb-2 block text-sm font-medium">
              <p>{"Tax " + quote.tax_slab + "% : "}</p>
            </div>
          </Col>
          <Col className="p-2 gutter-row border-b border-l text-center" span={4}>
            <div className="relative mt-2 rounded-md">
              <p>{Number(quote.tax_amount!).toLocaleString("en-US", { style: "currency", currency: "INR" })}</p>
            </div>
          </Col>

        </Row>

        <Row gutter={[12, 12]} className=' rounded-md-50'>
          <Col className="gutter-row" span={5}>
            <p>{' '}</p>
          </Col>
          <Col className="gutter-row" span={7}>
            <p>{' '}</p>
          </Col>
          <Col className="gutter-row" span={4}>
            <p>{' '}</p>
          </Col>
          <Col className="bg-gray-100 pt-3 gutter-row  border-b border-l text-center" span={4}>
            <label htmlFor="totalAmount" className=" text-sm font-medium">
              Total Amount :
            </label>
          </Col>
          <Col className="p-2 gutter-row border-b p-2 border-l text-center" span={4}>
            <div className="relative mt-2 rounded-md">
              <p>{Number(quote.quote_total_amount!).toLocaleString("en-US", { style: "currency", currency: "INR" })}</p>
            </div>
          </Col>

        </Row>
      </div>
    </>
  );
}





